import React, {Component} from 'react';

export class Education extends Component{
    render () {
        return(
            <section>
                <h1>EDUCATIONAL EXPERIENCE</h1><form>
                School Name: <br /><input type="text" name="schoolname" />
                <br />
                Title of Study: <br /><input type="text" name="studytitle" />
                <br />
                Date of Study: <br /><input type="date" name="dateofstudy" />
            </form>
            </section>            
        )
    }
}
